import React from 'react';
import bus from '../img/bus.png';

function Logo() {
    return (<div className="d-flex justify-content-center mt-4" >
         <img
        width="270" height="130" 
      src={bus}
      alt="First slide"
    />
    </div>);
}

export default Logo;
